Howard Jones - All I Want [promo].VOB



HQ very rare promo music video. &quot;All I Want&quot; is a single taken from Howard Jones's third studio album.

Released in October 1986 in the UK as the lead single from the album One to One, it reached #35 in the UK Singles Chart. In the United States, it was the third single from the album, and reached #76 on the Billboard Hot 100 chart.

Howard Jones (born John Howard Jones, 23 February 1955, Southampton, Hampshire, England) is a Welsh musician. According to the Guinness Book of British Hit Singles &amp; Albums, &quot;Jones is an accomplished singer-songwriter who was a regular chart visitor in the mid 1980s with his brand of synthpop. Jones, who was equally popular in the U.S., appeared at Live Aid&quot;. 

Allmusic journalist, Stephen Thomas Erlewine adds, &quot;Jones was one of the defining figures of mid 1980s synthpop. His music merged the technology intensive sound of new wave with the cheery optimism of hippies and late 1960s pop. Jones racked up a string of hits in the mid and late 1980s, before he retreated into being a cult figure in the 1990s&quot;.
